    false,nt"url": null,nt"notes": "BPI Zones are derived from a focal mean
    analysis on bathymetry and slope. The grid is based on gridded (5 m cell size) multibeam
    bathymetry, collected aboard NOAA ship Hi'ialakai and R/V AHI. It was created using
    the Benthic Terrain Modeler (http://www.csc.noaa.gov/products/btm/). Cell values
    represent one of 4 classes (crest, depression, flat, slope) in an index of seafloor
    terrains. This data set is for Brooks Banks, Hawaii, USA.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
